-- ----------------------------
-- Procedure structure for az
-- ----------------------------
DROP PROCEDURE IF EXISTS `az`;
delimiter ;;
CREATE PROCEDURE `az`()
BEGIN
    SELECT account.id, account.full_name, CONCAT(IF(account.phone IS NULL, "PHONE NULL|", ''), IF(TRIM(account.email) IS NULL, "EMAIL NULL", '')) as errorName
		 FROM account;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
